  - name: $$FormScript
    type: text
    data: |
      '++LotusScript Development Environment:2:5:(Options):0:66
      
      Option Declare
      
      '++LotusScript Development Environment:2:5:(Forward):0:1
      Declare Sub Querysave(Source As Notesuidocument, Continue As Variant)
      Declare Sub Postsave(Source As Notesuidocument)
      
      '++LotusScript Development Environment:2:5:(Declarations):0:2
      
      '++LotusScript Development Environment:2:2:Querysave:1:12
      Sub Querysave(Source As Notesuidocument, Continue As Variant)
      	' Querysave logic can be found in agents uidoc_saveandclose_class and uidoc_saveandclose_class_windows)
      End Sub
      '++LotusScript Development Environment:2:2:Postsave:1:12
      Sub Postsave(Source As Notesuidocument)
      	Dim s As New NotesSession
      	Dim thisDB As NotesDatabase  
      	Dim thisDoc As NotesDocument
      	Dim respcol As NotesDocumentCollection
      	Dim verdoc As NotesDocument, curdoc As NotesDocument 
      	Dim errtxt As String
      	
      	On Error Goto errHandler
      	
      	Set thisDb = s.CurrentDatabase
      	Set thisDoc = Source.Document
      	
      	' *********** Added 09 MAR 2023 (Rock) *************
      	' this code checks the F_CreateVerProperty item; 
      	' it checks for the LSXVersion property in the responses
      	' if true and one doesn't exist, it is created
      	' if false and one DOES exist, it is deleted
      	
      	' first, see if there's a lsxversion property doc
      	Set respcol = thisDoc.Responses
      	If Not(respcol Is Nothing) Then
      		Set curdoc = respcol.GetFirstDocument
      		Do While Not(curdoc Is Nothing)
      			If Lcase(curdoc.GetItemValue("Form")(0)) = "property" Then
      				If Lcase(curdoc.GetItemValue("F_PropName")(0)) = "lsxversion" Then
      					Set verdoc = curdoc
      					Exit Do
      				End If
      			End If
      			Set curdoc = respcol.GetNextDocument(curdoc)
      		Loop
      	End If
      	
      	' now create or nuke the lsxversion property doc based on the F_CreateVerProperty checkbox...
      	If Lcase(thisdoc.GetItemValue("F_CreateVerProperty")(0)) = "createver" Then
      		If verdoc Is Nothing Then
      			Set verdoc = thisDb.CreateDocument
      			With verdoc
      				.ReplaceItemValue "Form", "property"
      				.ReplaceItemValue "F_ProjectID", thisDoc.GetItemValue("F_ProjectID")
      				.ReplaceItemValue "F_ClassID", thisdoc.GetItemValue("F_ClassID")
      				.ReplaceItemValue "F_PropName", "LSXVersion"
      				.ReplaceItemValue "F_PropAttribute", "READ_ONLY"
      				.ReplaceItemValue "F_PropDataType", "String"
      				.ReplaceItemValue "F_InitValue", |LIT_STR("1.0")|
      				.ReplaceItemValue "Comment", "*** Auto-generated on " & Cstr(Now) & " ***"
      				.MakeResponse thisDoc
      				.ComputeWithForm True, False
      				.Save True, False, True
      			End With	
      			
      			Print "LSXVersion Property document automatically generated"
      		End If
      	Else
      		If Not(verdoc Is Nothing) Then
      			Call verdoc.Remove(True)
      			Print "LSXVersion Property document automatically deleted"
      		End If
      	End If
      	
      getOut:
      	Exit Sub
      	
      errHandler:
      	Select Case Err
      	Case 1000
      		errtxt = Error$
      	Case 1001 To 1050
      		errtxt = Error$ & " (in POSTSAVE - ln: " & Erl & ")"
      	Case Else
      		errtxt = Error$ & "(in POSTSAVE - er: " & Err & "; ln: " & Erl & ")"
      	End Select
      	
      	Msgbox errtxt,, "VSID Error"
      	Resume getOut
      	
      End Sub
      '++LotusScript Development Environment:2:2:BindEvents:1:129
      Private Sub BindEvents ( Byval ObjectName_ As String )
      	Static Source As NOTESUIDOCUMENT
      	Set Source = Bind(Objectname_)
      	On Event QUERYSAVE From Source Call QUERYSAVE
      	On Event POSTSAVE From Source Call POSTSAVE
      End Sub
